import { get } from 'lodash';
import { Component, OnInit } from '@angular/core';
import { NavParams } from '@ionic/angular';

@Component({
  selector: 'app-user-property-actions',
  templateUrl: './user-property-actions.component.html',
  styleUrls: ['./user-property-actions.component.scss']
})
export class UserPropertyActionsComponent implements OnInit {

  constructor(public navParams: NavParams) { }

  ngOnInit() {
  }

  goToProperty(){
    this.navParams.get('controller').dismiss({},'property');
  }

  deleteProperty(){
    this.navParams.get('controller').dismiss({},'delete');
  }

}
